import React from 'react';

import content from '../../Components/blog/posts/react_symfony.md';
import MarkDown from '../../Components/blog/markdown-parser/MarkDown';


const SymfonyReact = () => {
    return (
         <div className="main">
        	<MarkDown content={content} />
        </div>
    );
};


export default SymfonyReact;
